import React, { useState, useEffect } from "react";
// import {
//  UsersCard
// } from "./pages/Users";

import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import TableContainer from '@material-ui/core/TableContainer';
import TablePagination from '@material-ui/core/TablePagination';
import Typography from '@material-ui/core/Typography';
import { Link } from "react-router-dom";
import { withStyles, makeStyles } from '@material-ui/core/styles';
import { Button, ThemeProvider } from '@material-ui/core';
import EditIcon from '@material-ui/icons/Edit';
import ClearIcon from '@material-ui/icons/Clear';
import Snackbar from '@material-ui/core/Snackbar';
import MuiAlert from '@material-ui/lab/Alert';
import axios from 'axios';
import Menuadd from './Menuadd';
import MenuUpdate from './MenuUpdate';
import { Dialog } from '@material-ui/core';
import { TextField } from '@material-ui/core';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';



const Mapcomponent =( item, handleClose, handleClose1)=> {

const [open, setOpen] = React.useState(false);
const [open1, setOpen1] = React.useState(false);

const StyledTableRow = withStyles((theme) => ({
  root: {
    '&:nth-of-type(odd)': {
      backgroundColor: theme.palette.action.hover,
    },
  },
}))(TableRow);

return (

  <StyledTableRow hover role="checkbox" key={item.entreroffres_id}>

    <StyledTableCell >

      {item.entreroffres_id}
    </StyledTableCell >
    <StyledTableCell align="right">
      {item.nom}
    </StyledTableCell >
    <StyledTableCell align="right">
      {item.partner_id}
    </StyledTableCell >
    <StyledTableCell align="right">
      {item.createdAt}
    </StyledTableCell >
    <StyledTableCell align="right">
      {item.updatedAt}
    </StyledTableCell >
   


     
      <StyledTableCell align="right">

      <Link to={{
        pathname: '/MenuUpdate',

        state: { detail: { item } }
      }} >

        <Button style={{ marginLeft: '20px', marginTop: '50px', backgroundColor: '#008037' }} variant="outline-success"  >
          <EditIcon />

        </Button>
      </Link>



  
      </StyledTableCell>
      <StyledTableCell align="right">

      <Button style={{ marginLeft: '20px', marginTop: '50px', backgroundColor: '#008037' }} variant="outline-success" onClick={() => setOpen(true)} >
<ClearIcon />
</Button>
<Dialog
open={open}
onClose={handleClose1}

>
<DialogTitle >Confirmation</DialogTitle>
<DialogContent>
<DialogContentText >
Are you sure you want to delete this item !!!!!
</DialogContentText>
</DialogContent>
<DialogActions>
<Button onClick={handleClose1} color="primary">
No
</Button>
<Button onClick={() => alert(JSON.stringify(item))} color="primary" >
Yes
</Button>
</DialogActions>
</Dialog>
<Snackbar open={open1} autoHideDuration={2000} onClose={handleClose}>
<Alert onClose={handleClose} severity="success">
basket is successfully deleted!
</Alert>
</Snackbar>
</StyledTableCell >
  </StyledTableRow>
 

);
    };
    export default Mapcomponent;
